// Projects.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import tunermenucamber from './tuner-menu-camber.png';
import paragonPreview from '../assets/paragon-preview.png';
import { motion } from 'framer-motion';

const Projects: React.FC = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        duration: 0.4
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        duration: 0.3
      }
    }
  };

  return (
    <motion.section
      initial="hidden"
      animate="visible"
      variants={containerVariants}
      className="min-h-screen pt-24 pb-12 px-4 bg-gradient-to-b from-slate-900/95 to-slate-800/90"
    >
      <div className="max-w-6xl mx-auto">
        {/* Header Section */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold text-white mb-4">
            Featured Projects
          </h2>
          <p className="text-gray-300 text-lg max-w-2xl mx-auto">
            Explore my portfolio of web applications and development projects
          </p>
        </motion.div>

        {/* Projects Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 mb-16">
          {/* Paragon Website Project */}
          <motion.div 
            variants={itemVariants} 
            className="group bg-slate-800/30 p-6 rounded-xl hover:bg-slate-700/30 transition-all duration-300"
          >
            <div className="relative">
              <div className="flex justify-center mb-6">
                <div className="relative w-full h-64 rounded-lg overflow-hidden">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-900/30 to-slate-800/30 z-10"></div>
                  <img 
                    src={paragonPreview}
                    alt="Paragon Website" 
                    className="w-full h-full object-cover rounded-lg transition-transform duration-300 group-hover:scale-[1.02]" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-xl font-bold mb-3 text-white">Paragon Website</h3>
                <p className="text-gray-300 mb-4 text-base">A modern, responsive website built with React and TypeScript</p>
                <Link 
                  to='/project2' 
                  className="inline-block px-6 py-3 bg-primary/80 text-white font-medium rounded-lg hover:bg-primary transition-all duration-300"
                >
                  View Project
                </Link>
              </div>
            </div>
          </motion.div>

          {/* FiveM Project */}
          <motion.div 
            variants={itemVariants} 
            className="group bg-slate-800/30 p-6 rounded-xl hover:bg-slate-700/30 transition-all duration-300"
          >
            <div className="relative">
              <div className="flex justify-center mb-6">
                <div className="relative w-full h-64 rounded-lg overflow-hidden">
                  <div className="absolute inset-0 bg-gradient-to-br from-slate-900/30 to-slate-800/30 z-10"></div>
                  <img 
                    src={tunermenucamber} 
                    alt="FiveM Project" 
                    className="w-full h-full object-cover rounded-lg transition-transform duration-300 group-hover:scale-[1.02]" 
                  />
                </div>
              </div>
              <div className="text-center">
                <h3 className="text-xl font-bold mb-3 text-white">FiveM Vehicle Tuning Interface</h3>
                <p className="text-gray-300 mb-4 text-base">A custom UI for vehicle tuning in FiveM servers</p>
                <Link 
                  to='/project1' 
                  className="inline-block px-6 py-3 bg-primary/80 text-white font-medium rounded-lg hover:bg-primary transition-all duration-300"
                >
                  View Project
                </Link>
              </div>
            </div>
          </motion.div>
        </div>

        {/* Portfolio Repository Link */}
        <motion.div 
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3 }}
          className="text-center border-t border-slate-700/20 pt-8"
        >
          <p className="text-gray-300 font-medium mb-4">
            View the repository for this Website Portfolio
          </p>
          <a 
            href="https://github.com/dasz4376/portfolio" 
            target="_blank"
            rel="noopener noreferrer"
            className="inline-block px-6 py-3 bg-primary/80 text-white font-medium rounded-lg hover:bg-primary transition-all duration-300"
          >
            View Repository
          </a>
        </motion.div>
      </div>
    </motion.section>
  );
}

export default Projects;
